const config = {
    sports : [
        { label: 'Select', name: 'Select' },
        { label: 'Cricket', name: 'Cricket' },
        { label: 'Football', name: 'Football' }
    ],
    cricket: [
        { label: 'Wicket Keeper', name: 'Wicket Keeper'},
        { label: 'Batsman', name: 'Batsman'},
        { label: 'Bowler', name: 'Bowler'},
        { label: 'All Rounder', name: 'All Rounder'},
    ],
    football: [
        { label: 'Defender', name: 'Defender'},
        { label: 'Stricker', name: 'Stricker'},
    ],
}

export default config;
